import Link from 'next/link';

const Navbar = () => {
return (
    <nav class="navbar navbar-expand-lg navbar-dark bg-primary">
        <ul>
            <li>
                <Link href="/">Home</Link>
            </li>
            <li>
                <Link href="/about">About</Link>
            </li>
            <li>
                <Link href="/myplants">My Plants</Link>
            </li>
        </ul>
    </nav>
)
};

export default Navbar;
